import './input.css';

function Input(props) {
  return (
    <div className="input">
        <label className="input__label" for="input">{props.label}</label>
        <div className={`input__input_group ${props.gcname}`}>
          <span className={`input_group__icon-left ${props.ilcname}`}>
            <svg viewBox="0 0 16 16" fill="none" stroke={props.lstroke} xmlns="http://www.w3.org/2000/svg">
              <path d={props.lpath} fill="none" />
            </svg>
          </span>
          <input type="text" className="input_group__text" placeholder={props.placeholder} value={props.value}/>
          <span className={`input_group__icon-right ${props.ircname}`}>
            <svg viewBox="0 0 16 16" fill="none" stroke={props.rstroke} xmlns="http://www.w3.org/2000/svg">
              <path d={props.rpath} fill="none" />
            </svg>
          </span>
        </div>
    </div>
  );
}

export default Input;
